import React from 'react'
import PropTypes from 'prop-types';
import styles from './styles.module.css'



const Button = ({ content, onClick, htmlType, type, focusVisible, onFocus, onBlur }) => { 
    const typeClass = typeClasses[type];
  const focusedClass = focusVisible ? focusedTypeClasses[type] : '';

    return (
        <div >
            <button className={styles.start}  type={htmlType}
      onClick={onClick}
      onBlur={onBlur}
      onFocus={onFocus} >Create fanfic</button>
        </div>
    )

}

Button.propTypes = {
    content: PropTypes.string.isRequired,
    onClick: PropTypes.func,
    htmlType: PropTypes.string,
    type: PropTypes.string,
    focusVisible: PropTypes.bool,
    onFocus: PropTypes.func,
    onBlur: PropTypes.func,
  };
  
  Button.defaultProps = {
    onClick: () => {},
    htmlType: 'button',
    type: 'primary',
    focusVisible: false,
    onFocus: () => {},
    onBlur: () => {},
  };

export default Button
